const text = (
  state = "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi sollicitudin tempor metus quis tempus. Donec sodales purus velit, vel facilisis mi bibendum vitae. Duis a maximus est. Aliquam vulputate rutrum euismod. Mauris finibus, eros ac convallis suscipit, leo est laoreet mauris, quis consequat nunc odio eget massa. Phasellus bibendum mauris non iaculis molestie. Donec sit amet risus dui. Sed in sapien at arcu accumsan commodo id sed leo. Curabitur ultrices sit amet neque eget porta. Proin fringilla varius scelerisque. Maecenas consectetur sit amet leo ut hendrerit. Donec ac vehicula nibh. Etiam malesuada finibus dolor nec rutrum.",
  action
) => {
  switch (action.type) {
    case "TEXT":
      return action.text;
    default:
      return state;
  }
};

export default text;
